// src/App.js
import React from 'react';
import DogList from './components/DogList';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Adoption Center</h1>
      </header>
      <main>
        <DogList />
      </main>
    </div>
  );
};

export default App;
